import collegeLogo from './assets/CollegeLogo.png';

export default function Login() {
    return (
        <div className='login-background'>
            <div className='login-panel'>
                <img src={collegeLogo} className='college-logo' alt='college logo'/>
            </div>
        </div>
    );
}
